DROP TABLE IF EXISTS `t_commodity`;
CREATE TABLE `t_commodity` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT '' COMMENT '商品名称',
  `name_pinyin` varchar(100) DEFAULT '',
  `name_pinyin_first` varchar(20) DEFAULT '',
  `norm` varchar(255) DEFAULT '' COMMENT '规格',
  `lot_number` varchar(255) DEFAULT '' COMMENT '批号',
  `inventory` int(11) DEFAULT '0' COMMENT '库存',
  `retail_price` double DEFAULT '0' COMMENT '零售价',
  `supply_price` double DEFAULT '0' COMMENT '供货价',
  `wholesale_price` double DEFAULT '0' COMMENT '批发价',
  `create_username` varchar(255) DEFAULT '',
  `create_user_id` int(11) DEFAULT '0',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `update_username` varchar(255) DEFAULT '',
  `update_user_id` int(11) DEFAULT '0',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `remark` varchar(255) DEFAULT '',
  `amount` double DEFAULT '0' COMMENT '金额',
  `unit` varchar(10) DEFAULT '' COMMENT '单位',
  `health_permit` varchar(255) DEFAULT '' COMMENT '卫生许可证',
  `valid_until` date DEFAULT NULL COMMENT '有效期至',
  `quality` varchar(255) DEFAULT '' COMMENT '质量',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_index` (`id`) USING BTREE,
  FULLTEXT KEY `full_name_pinyin_search1` (`name_pinyin`),
  FULLTEXT KEY `full_name_pinyin_search2` (`name_pinyin_first`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8;

