DROP TABLE IF EXISTS `t_company`;
CREATE TABLE `t_company` (
  `id` int(30) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) DEFAULT '' COMMENT '企业名称（营业执照上的名称）',
  `name_pinyin` varchar(100) DEFAULT '' COMMENT '拼音全小写字母',
  `name_pinyin_first` varchar(20) DEFAULT '' COMMENT '拼音首字母',
  `address` varchar(40) DEFAULT '' COMMENT '企业地址（营业执照上的地址）',
  `address_pinyin` varchar(200) DEFAULT '' COMMENT '拼音全小写字母',
  `address_pinyin_first` varchar(40) DEFAULT '' COMMENT '拼音首字母',
  `uniform_credit_code` varchar(50) DEFAULT '' COMMENT '企业统一信用代码',
  `logo` varchar(255) DEFAULT '' COMMENT '企业logo（base64码）',
  `related_pictures` varchar(255) DEFAULT '' COMMENT '企业相关图片(base64码 多个图片以英文逗号隔开)',
  `create_username` varchar(20) DEFAULT '',
  `create_user_id` int(11) DEFAULT '0',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `update_username` varchar(20) DEFAULT '',
  `update_user_id` int(11) DEFAULT '0',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `remark` varchar(255) DEFAULT '',
  `phone` varchar(11) DEFAULT '' COMMENT '电话',
  `landline` varchar(12) DEFAULT '' COMMENT '座机',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_index` (`id`) USING BTREE,
  KEY `name_index` (`name`,`address`) USING BTREE,
  FULLTEXT KEY `full_text_search` (`name_pinyin`,`address_pinyin`),
  FULLTEXT KEY `full_text2_search` (`name_pinyin_first`,`address_pinyin_first`)
) ENGINE=InnoDB AUTO_INCREMENT=10197 DEFAULT CHARSET=utf8;

