  `sender_phone` varchar(12) DEFAULT '' COMMENT '发货人电话',
  `sender_name` varchar(20) DEFAULT '' COMMENT '发货人姓名',
  `lump_sum_chinese` varchar(20) DEFAULT '' COMMENT '总金额大写',
  PRIMARY KEY (`id`)
